import React from 'react';
import { useHistory } from 'react-router';
import { Link } from 'react-router-dom';
import Header from '../../components/header';

export default function ProfileScreen() {
  const email = JSON.parse(localStorage.getItem('user'));

  function cleanStorage() {
    const history = useHistory();
    localStorage.clear();
    history.push('/comidas');
  }
  return (
    <>
      <Header title="Perfil" isSearch={ false } />
      <p data-testid="profile-email">{Object.values(email)}</p>
      <Link to="/receitas-feitas">
        <button type="button" data-testid="profile-done-btn">Receitas Feitas</button>
      </Link>
      <Link to="receitas-favoritas">
        <button type="button" data-testid="profile-favorite-btn">Receitas Favoritas</button>
      </Link>
      <button type="button" data-testid="profile-logout-btn" onClick={ () => cleanStorage() }>Sair</button>
    </>
  );
}
